import React, { act, Fragment } from "react";

const Home = () => {
    const previousActive = document.querySelectorAll(".navbar-link-active");
    if(previousActive.length !== 0) {
        for(let i = 0; i < previousActive.length; i++) {
            previousActive[i].classList.remove("navbar-link-active");
        }
    }
    const activeLink = document.getElementById('home-nav-link');
    if(activeLink.classList) {
        activeLink.classList.add("navbar-link-active");
    }

    return (
        <Fragment>
            <h1>Home</h1>
        </Fragment>
    );
};

export default Home;
